// frontend/src/components/AssetListPanel.js
import React, { useEffect, useState } from 'react';
import { fetchSavedAssets } from '../services/apiService';

const AssetListPanel = () => {
  const [assets, setAssets] = useState([]); // Initialize as an empty array

  useEffect(() => {
    const loadAssets = async () => {
      try {
        const savedAssets = await fetchSavedAssets();
        setAssets(savedAssets || []); // Set to empty array if savedAssets is undefined
      } catch (error) {
        console.error("Error fetching saved assets:", error);
        setAssets([]); // Set to empty array in case of an error
      }
    };
    loadAssets();
  }, []);

  return (
    <div className="asset-list-panel">
      <h2>Saved Assets</h2>
      <ul>
        {assets.map((asset, index) => (
          <li key={index}>{asset.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default AssetListPanel;
